const PageContainer = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  height: 100vh;
  background-color: #1a1d2a;
  color: white;
  text-align: center;
`;

const Logo = styled.img`
  width: 120px;
  height: 120px;
  margin-bottom: 20px;
`;

const Title = styled.h1`
  font-size: 24px;
  font-weight: bold;
`;

const Subtitle = styled.p`
  font-size: 16px;
`;

const logoPath = "../img/mp_logo.png";

