  return (
    <PageContainer>
      <Header />
      <Logo src={logo} alt="Mentor Program Logo" />

      <Title>Mentor Program</Title>
      <Subtitle>Aiming to bring first-year students together ðŸ˜Š</Subtitle>
      <SocialLinks />
      <Footer />
    </PageContainer>
  );
};

export default Homepage;
